What is printed to console.log?

Promise.resolve({
    name: "Jane"
}).then(function (o) {
    o.job = "Heiress";
    return o;
}, function (o) {
    o.job = "Slob";
    return o;
}).then(function (o) {
    o.school = "Uni";
    return o;
}, function (o) {
    o.school = "Elementary";
    return o;
}).then(function (o) {
    console.log(o.name, o.job, o.school);
}, function (o) {
    console.log(o.name, o.job, o.school);
});

