var janeGenerator = function () {
    var p = new Promise(function (resolve, reject) {
        setTimeout(function () {
            if (Math.random() > 0.5) {
                resolve({
                    name: "Jane"
                })
            } else {
                reject({
                    name: "Jane"
                })
            }
        }, 1000);
    });
    return p;
};

janeGenerator().then(function (o) {
    o.job = "CEO";
    return o;
}, function (o) {
    o.job = "VP";
    return o;
}).then(function (o) {
    o.house = "Big";
    return o;
}).then(function (o) {
    console.log(o.name, o.job, o.house);
}).catch(function (o) {
    console.log(o.name, o.job);
});

class Animal {
    constructor(name) {
        this.name = name || "Frida";
    }
    speak() {
        return this.name;
    }
}
class Cat extends Animal {
    speak() {
        return super.speak() + " says meow!";
    }
}
var k = new Cat("Khalo");
console.log(k.speak());

class Animal {
    constructor(name) {
        this.name = name || "Frida";
    }
    speak() {
        return this.name;
    }
}
class Cat extends Animal {
    speak() {
        return super.speak() + " says meow!";
    }
}
var k = new Cat("Khalo");
k.speak = function () {
    return super.speak() + " says woof!";
};
console.log(k.speak());

class Animal {
    constructor(name) {
        this.name = name || "Frida";
    }
    speak() {
        return this.name;
    }
}
class Cat extends Animal {
    speak() {
        return super.speak() + " says meow!";
    }
}
Cat.prototype.speak = function () {
    return Animal.prototype.speak.call(this) + " says woof!";
};
var k = new Cat("Khalo");
console.log(k.speak());

class Animal {
    constructor(name) {
        this.name = name || "Frida";
    }
    speak() {
